import './App.scss';
import {BrowserRouter, Switch, Route} from "react-router-dom";
import Navigation from "./components/Navigation";
import Home from "./components/Home";
import About from "./components/About";
import Mars from "./components/Mars";
import Earth from "./components/Earth";
import Spotd from "./components/Spotd";
import React from "react";
import Spiritopportunity from "./rovers/Spiritopportunity";
import Curiosity from "./rovers/Curiosity";
import ScrollToTop from "./general/ScrollToTop";

function App() {
  return (
    <BrowserRouter>
      <ScrollToTop />
        <Navigation />
        <Switch>
          <Route path="/" exact>
            <Home />
          </Route>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/mars" exact>
            <Mars />
          </Route>
          <Route path="/mars/spiritopportunity">
            <Spiritopportunity />
          </Route>
          <Route path="/mars/curiosity">
            <Curiosity />
          </Route>
          <Route path="/earth">
            <Earth />
          </Route>
          <Route path="/spotd">
            <Spotd />
          </Route>
        </Switch>
    </BrowserRouter>

  );
}

export default App;
